import React from 'react';

const About = () => {
    return (
        <div className="about">
            <h6 className="about_intro">
                Lorem ipsum dolor sit amet, 
                consectetur adipiscing elit. 
                Curabitur urna velit, eleifend quis neque vitae, 
                molestie tempus urna.
            </h6>
            div.container.
        </div>
    );
};

export default About;
